import "./index.css";
import CountryComponent from "./CountryComponent";

export default function App() {
  const countryInfos = {
    name: "Chevrolet",
    region: "General Motors",
    currency: "2020",
    president: "30000 USD",
    image: "Silver gray"
  };

  return (
    <div className="App">

      <CountryComponent
        details={countryInfos}
      />
    </div>
  );
}
